import React from 'react';
import Banner from './Banner.PNG';
import './welcome.css';
import contact from './contact.png';
import transaction from './transaction.png';
import login from './login.png';
import writhdraw from './withdraw.png';


const Welcomepage = () => {
  return (
    <div>
      <div className='banner'>
        <img src={Banner} className="App-banner" class="img-fluid" alt="banner"/>
      </div>
      <div class="text-center"><h1 class="display-6">What can we help you?</h1></div>
      <div class="row" className='buttons'>
      <div class = 'col'>
        <img src={transaction} className="transaction"  class="rounded float-start" alt="banner" style={{marginRight: 10, width: 100}}/>
      </div> 
      <div class = 'col' >
        <img src={writhdraw} className="withdraw" class="rounded float-start" alt="banner" style={{marginRight: 10, width: 100}}/>
      </div>
      <div class = 'col' >
        <img src={login} className="login"  class="rounded float-start" alt="banner" style={{marginRight: 10, width: 100}}/>
      </div>
      <div class = 'col' >
        <img src={contact} className="contact"  class="rounded float-start" alt="banner" style={{width: 100}}/>
      </div>
      </div>
    </div> 
  );
};

export default Welcomepage;
